// src/pages/Chapters/FortWorth.js
import React from 'react';
import Header from '../../components/Header';
import Footer from '../../components/Footer';
import banner from '../../assets/images/chapters/Fort Worth/banner.png';
import '../../assets/fonts/Quicksand-Regular.ttf';
import '../../assets/fonts/Poppins-Regular.ttf';

const FortWorth = () => (
    <div>
        <Header />
        {/* Banner Section */}
        <div style={styles.banner}>
            <h1 style={styles.bannerText}>Fort Worth Chapter</h1>
        </div>
        {/* Main Content Section */}
        <div style={styles.contentSection}>
            <div style={styles.text}>
            In Fort Worth, the Ummati Community chapter brings women together to foster connections, inspire growth, and provide a supportive community. Our Fort Worth chapter is centered on inclusivity and empathy, with events and programs that allow women to meet, engage, and build friendships. Through shared experiences and engaging activities, members find a safe space where they can thrive together.
            </div>
        </div>
        <Footer />
    </div>
);

const styles = {
    banner: {
        width: '100%',
        height: '300px', // Adjust height as needed
        backgroundImage: `url(${banner})`,
        backgroundSize: 'cover', // Ensures image covers the entire banner
        backgroundPosition: 'center', // Centers the background image
        position: 'relative', // Allows absolute positioning for inner elements
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    bannerText: {
        color: 'black',
        fontFamily: 'Caprasimo',
        fontSize: '56px',
        position: 'absolute', // Position text absolutely within the banner
        top: '80%', // Position the text two-thirds down within the banner
        transform: 'translateY(-50%)',
        fontWeight: '400',
    },
    contentSection: {
        background: '#F7F5EF',
        padding: '40px 20px',
        textAlign: 'left',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    text: {
        width: '100%',
        maxWidth: '1200px',
        color: 'black',
        fontSize: '22px',
        fontFamily: 'Poppins',
        fontWeight: '400',
        wordWrap: 'break-word',
    },
};

export default FortWorth;
